// MARK: - String Extension

public extension String {
    /// Localize a string key
    var localized: String {
        NSLocalizedString(self, comment: "")
    }

    /// Localize a string key with arguments
    func localized(_ args: CVarArg...) -> String {
        String(format: NSLocalizedString(self, comment: ""), arguments: args)
    }
}

// MARK: - LocalizedStringKey Extension

public extension LocalizedStringKey {
    /// Initialize from a translation key
    init(_ key: String, comment: String = "") {
        self.init(stringLiteral: NSLocalizedString(key, comment: comment))
    }
}
